import "./listItem.scss";

export default function ListItem() {
    return (
        <div className="listItem">
            <img src="Akalist.jpg" alt="" />
            <div className="itemInfo">
                <div className="icons">
                    <PlayArrow />
                </div>
            </div>
        </div>
    );
}
